import React, { Component } from 'react';
import Button from './components/Button';
// import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to the Credit Clerk!
        </p>
        <h1>Learn React</h1>
        <form>
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
        <Button />
      </header>
    </div>
  );
}

export default App;
